import { ShopActionTypes } from './shop.types';
import { shopData } from './shopdata'

const INITIAL_STATE = {
    collections: shopData
}

export const shopReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case ShopActionTypes.UPDATE_SHOP:
            return
        default:
            return state;
    }
}
